import React, { useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';

const Hero = () => {
  const textRef = useRef(null);
  const cardRef = useRef(null);

  useEffect(() => {
    const targets = [textRef.current, cardRef.current];
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('animate-in');
          }
        });
      },
      { threshold: 0.2 }
    );
    targets.forEach((el) => el && observer.observe(el));
    return () => observer.disconnect();
  }, []);
  return (
    <section className="hero">
      <div className="hero-background">
        <div className="hero-gradient"></div>
        <div className="floating-shapes">
          <div className="shape shape-1"></div>
          <div className="shape shape-2"></div>
          <div className="shape shape-3"></div>
          <div className="shape shape-4"></div>
        </div>
      </div>
      
      <div className="container">
        <div className="hero-content">
          <div className="hero-text" ref={textRef}>
            <div className="badge">Bihar IT Solution</div>
            <h1 className="hero-title">
              We Build
              <span className="gradient-text"> Digital Experiences</span>
              <br />That Drive Results
            </h1>
            <p className="hero-subtitle">
              Transform your business with custom web solutions that combine stunning design, 
              powerful functionality, and innovative solutions.
            </p>
            <div className="hero-actions">
              <Link to="/contact" className="btn-primary">
                Start Your Project <span className="btn-icon">â†’</span>
              </Link>
              <Link to="/services" className="btn-secondary">
                View Services
              </Link>
            </div>
          </div>
          
          <div className="hero-visual">
            <div className="hero-card" ref={cardRef}>
              <div className="card-header"><div className="status-dots"><span></span><span></span><span></span></div></div>
              <div className="card-content">
                <div className="code-line"><span className="code-keyword">const</span> website = <span className="code-string">'Amazing'</span>;</div>
                <div className="code-line"><span className="code-keyword">if</span> (website === <span className="code-string">'Amazing'</span>) &#123;</div>
                <div className="code-line indent"><span className="code-function">return</span> <span className="code-string">'Success!'</span>;</div>
                <div className="code-line">&#125;</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
